import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (using text "All" in .nav-menu)
    const navMenuSelector = '.nav-menu';
    await page.waitForSelector(navMenuSelector, { timeout: 5000 });

    // Click the mobile menu trigger
    await page.click(navMenuSelector);

    // Wait for the mobile menu overlay to appear (using #mobileMenuOverlay with .show class)
    const mobileMenuOverlaySelector = '#mobileMenuOverlay.show';
    await page.waitForSelector(mobileMenuOverlaySelector, { timeout: 5000 });

    // Take screenshot of the open mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Wait for a category link inside the mobile menu (e.g., text 'Electronics')
    // Use XPath to ensure we find the link inside the overlay
    const electronicsLinkXPath = "//div[contains(@class,'mobile-menu-overlay') and contains(@class,'show')]//a[contains(.,'Electronics')]";
    await page.waitForSelector(`xpath=${electronicsLinkXPath}`, { timeout: 5000 });

    // Click the 'Electronics' link
    await page.click(`xpath=${electronicsLinkXPath}`);

    // Wait for the main content to update (look for heading or category card)
    // Use text 'Electronics' in a heading or card
    const electronicsCategorySelector = "h2, .category-card, .category-results, .products-grid";
    await page.waitForSelector(electronicsCategorySelector, { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Re-open mobile menu to test closing
    await page.click(navMenuSelector);
    await page.waitForSelector(mobileMenuOverlaySelector, { timeout: 5000 });

    // Wait for the close button inside the overlay (using button.close-mobile-menu inside overlay)
    const closeBtnXPath = "//div[contains(@class,'mobile-menu-overlay') and contains(@class,'show')]//button[contains(@class,'close-mobile-menu')]";
    await page.waitForSelector(`xpath=${closeBtnXPath}`, { timeout: 5000 });

    // Click the close button
    await page.click(`xpath=${closeBtnXPath}`);

    // Wait for the overlay to disappear
    await page.waitForSelector(mobileMenuOverlaySelector, { state: 'detached', timeout: 5000 });

    // Take screenshot after closing mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    // Extract some data to verify navigation
    // For example, get the first product/category card title after navigation
    let categoryTitle = '';
    const categoryCard = await page.$('.category-card h3');
    if (categoryCard) {
      categoryTitle = await categoryCard.textContent();
    } else {
      // Fallback: try to get heading
      const heading = await page.$('h2');
      if (heading) {
        categoryTitle = await heading.textContent();
      }
    }

    return {
      success: true,
      action: "Tested mobile menu navigation: open, navigate to Electronics, and close menu",
      extractedData: {
        navigatedCategory: categoryTitle ? categoryTitle.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
